import React, { useState } from "react";
import axios from "axios";

function App() {
  const [url, setUrl] = useState("");
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  const checkUrl = async () => {
    if (!url) {
      setError("Please enter a URL.");
      return;
    }

    setLoading(true);
    setError("");
    setResult(null);

    try {
      const res = await axios.get(
        `http://127.0.0.1:8000/predict-url?url=${encodeURIComponent(url)}`
      );
      setResult(res.data);
    } catch (err) {
      setError("Backend not reachable.");
    }

    setLoading(false);
  };

  return (
    <div style={styles.page}>
      <div style={styles.card}>
        <h1 style={styles.title}>AI Phishing URL Detector</h1>
        <p style={styles.subtitle}>
          Analyze URLs using machine learning & feature engineering.
        </p>

        <input
          type="text"
          placeholder="https://example.com"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          style={styles.input}
        />

        <button onClick={checkUrl} style={styles.button}>
          Analyze URL
        </button>

        {loading && <p style={styles.loading}>Analyzing...</p>}
        {error && <p style={styles.error}>{error}</p>}

        {result && (
          <div style={styles.resultBox}>
            <h2 style={styles.resultTitle}>Analysis Result</h2>

            <div style={styles.row}>
              <span>Final Prediction:</span>
              <strong
                style={{
                  color:
                    result.final_prediction === "Phishing"
                      ? "#ff4d6d"
                      : "#2a9d8f",
                }}
              >
                {result.final_prediction}
              </strong>
            </div>

            <div style={styles.row}>
              <span>ML Prediction:</span>
              <strong>{result.ml_prediction}</strong>
            </div>

            <div style={styles.row}>
              <span>ML Probability:</span>
              <strong>{(result.ml_probability * 100).toFixed(2)}%</strong>
            </div>
          </div>
        )}
      </div>
    </div>
  );
}

// ------------------ COLORFUL PROFESSIONAL UI ------------------

const styles = {
  page: {
    minHeight: "100vh",
    background:
      "linear-gradient(135deg, #6a11cb, #2575fc, #00c9ff, #92fe9d)",
    backgroundSize: "300% 300%",
    animation: "gradientFlow 12s ease infinite",
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    padding: 20,
    fontFamily: "'Inter', sans-serif",
  },

  card: {
    width: "100%",
    maxWidth: "500px",
    background: "rgba(255, 255, 255, 0.9)",
    padding: "32px",
    borderRadius: "16px",
    boxShadow: "0 8px 30px rgba(0,0,0,0.15)",
  },

  title: {
    fontSize: "30px",
    fontWeight: "700",
    color: "#222",
    marginBottom: "6px",
  },

  subtitle: {
    fontSize: "14px",
    color: "#555",
    marginBottom: "22px",
  },

  input: {
    width: "100%",
    padding: "14px",
    fontSize: "16px",
    borderRadius: "10px",
    border: "1.5px solid #ccc",
    outline: "none",
    marginBottom: "18px",
  },

  button: {
    width: "100%",
    padding: "14px",
    fontSize: "16px",
    fontWeight: "600",
    border: "none",
    borderRadius: "10px",
    cursor: "pointer",
    background:
      "linear-gradient(135deg, #ff4d6d, #f857a6, #6a11cb)",
    color: "white",
    marginBottom: "20px",
    boxShadow: "0 4px 15px rgba(0,0,0,0.15)",
  },

  loading: { textAlign: "center", color: "#444", fontSize: "16px" },
  error: { textAlign: "center", color: "#ff4d6d", fontSize: "16px" },

  resultBox: {
    background: "#f1f1f1",
    padding: "20px",
    borderRadius: "10px",
    marginTop: "20px",
    border: "1px solid #ddd",
  },

  resultTitle: {
    fontSize: "20px",
    fontWeight: "600",
    marginBottom: "14px",
    color: "#333",
  },

  row: {
    display: "flex",
    justifyContent: "space-between",
    fontSize: "16px",
    marginBottom: "10px",
  },
};

// Add gradient animation
const sheet = document.styleSheets[0];
sheet.insertRule(`
@keyframes gradientFlow {
  0% { background-position: 0% 50%; }
  50% { background-position: 100% 50%; }
  100% { background-position: 0% 50%; }
}
`);

export default App;
